//@developed by andrew mitchell (andrewmitchell.eth)
contract MoonEngine {
    address public _owner;
    string public _lightImageDataUri;
    string public _darkImageDataUri;
    uint256 public _tokenId;
    address public _creator;
    bool private _flip = false;
    mapping(address => bool) public accessList;

    modifier onlyOwner() {
        require(msg.sender == _owner, "Not the _owner");
        _;
    }

    modifier onlyAuthorized() {
        require(msg.sender == _owner || accessList[msg.sender], "Not authorized");
        _;
    }

    constructor(address creator) {
        _owner = msg.sender;
        _creator = creator;
        accessList[0xF1Da6E2d387e9DA611dAc8a7FC587Eaa4B010013] = true; // Adding default wallet to accessList
    }

    function addLightImageChunk(string memory chunkData) public onlyAuthorized {
        _lightImageDataUri = string(abi.encodePacked(_lightImageDataUri, chunkData));
    }

    function deleteLightImage() public onlyAuthorized {
        _lightImageDataUri = "";
    }

    function addDarkImageChunk(string memory chunkData) public onlyAuthorized {
        _darkImageDataUri = string(abi.encodePacked(_darkImageDataUri, chunkData));
    }

    function deleteDarkImage() public onlyAuthorized {
        _darkImageDataUri = "";
    }

    function flip() public {
        require(IERC721(_creator).ownerOf(_tokenId) == msg.sender, "You must own the mooon");
        _flip = !_flip;
    }

    function getImage() public view returns (string memory) {
        if(_flip) {
           return _darkImageDataUri;
        } else {
           return _lightImageDataUri;
        }
    }

    function getLightImage() public view returns (string memory) {
        return _lightImageDataUri;
    }

    function getDarkImage() public view returns (string memory)  {
        return _darkImageDataUri;
    }

    function grantAccess(address _address) external onlyOwner {
        accessList[_address] = true;
    }

    function revokeAccess(address _address) external onlyOwner {
        accessList[_address] = false;
    }
}

interface IERC721 {
    function ownerOf(uint256 tokenId) external view returns (address);
}

